public class InnerModelCardContentFactory(Action<Humidifier.SageMaker.ModelCardTypes.Content> factoryAction = null) : SubResourceFactory<Humidifier.SageMaker.ModelCardTypes.Content>
{

    internal InnerModelCardIntendedUsesFactory IntendedUsesFactory { get; set; }

    internal InnerModelCardAdditionalInformationFactory AdditionalInformationFactory { get; set; }

    internal InnerModelCardModelOverviewFactory ModelOverviewFactory { get; set; }

    internal InnerModelCardTrainingDetailsFactory TrainingDetailsFactory { get; set; }

    internal InnerModelCardModelPackageDetailsFactory ModelPackageDetailsFactory { get; set; }

    internal InnerModelCardBusinessDetailsFactory BusinessDetailsFactory { get; set; }

    protected override Humidifier.SageMaker.ModelCardTypes.Content Create()
    {
        var contentResult = CreateContent();
        factoryAction?.Invoke(contentResult);

        return contentResult;
    }

    private Humidifier.SageMaker.ModelCardTypes.Content CreateContent()
    {
        var contentResult = new Humidifier.SageMaker.ModelCardTypes.Content();

        return contentResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.ModelCardTypes.Content result)
    {
        base.CreateChildren(result);

        result.IntendedUses ??= IntendedUsesFactory?.Build();
        result.AdditionalInformation ??= AdditionalInformationFactory?.Build();
        result.ModelOverview ??= ModelOverviewFactory?.Build();
        result.TrainingDetails ??= TrainingDetailsFactory?.Build();
        result.ModelPackageDetails ??= ModelPackageDetailsFactory?.Build();
        result.BusinessDetails ??= BusinessDetailsFactory?.Build();
    }

} // End Of Class

